def _clone_functional_model(model, input_tensors=None):
    if not isinstance(model, Model):
        raise ValueError('Expected `model` argument to be a `Model` instance, got ', model)
    if isinstance(model, Sequential):
        raise ValueError('Expected `model` argument to be a functional `Model` instance, got a `Sequential` instance instead:', model)

    input_layers = []
    output_layers = []
    layer_map = {}
    tensor_map = {}

    if input_tensors is None:
        input_tensors = [Input(batch_shape=layer.batch_input_shape, dtype=layer.dtype) for layer in model._input_layers]

    for layer, input_tensor in zip(model._input_layers, input_tensors):
        input_layers.append(input_tensor)
        layer_map[layer] = input_tensor

    for layer in model.layers:
        new_layer = layer.__class__.from_config(layer.get_config())
        layer_map[layer] = new_layer
        tensor_map[layer.output] = new_layer.output

    model_outputs = [tensor_map[out] for out in model.outputs]

    return Model(input_layers, model_outputs, name=model.name)
